  false,\n\t\"url\": null,\n\t\"notes\": \"The nearshore sensors are part of the Pacific
  Islands Ocean Observing System (PacIOOS) and are designed to measure a variety of
  ocean parameters at fixed point locations along the south shore of Oahu. NS02 is
  located at a floating dock off the Hawaii Yacht Club. The instrument is a Sea-Bird
  Electronics model 16+ V2 coupled with a WET Labs ECO-FLNTUS combination sensor.
  The package is fixed to a floating dock just below the ocean surface.\",\n\t\"license_title\":
